INSERT INTO `news` (`news_ID`, `title`, `description`, `date`, `author`, `picture`, `n_status`) VALUES
(1, 'More than 12 million fully vaccinated against COVID-19 in Sri Lanka\r\n', 'The total number of individuals fully vaccinated against COVID-19 in Sri Lanka exceeded the 12 million on Wednesday (October 06). The Epidemiology UniThe total number of individuals fully vaccinated against COVID-19 in Sri Lanka exceeded the 12 million on Wednesday (October 06). The Epidemiology Unit of the Ministry of Health stated that 12,043,368 people – 56% of the total population – have received both doses of a COVID-19. According to official data, 14,639,679 people in total have received at least one dose of a COVID vaccine. Sri Lanka has approved AstraZeneca, Covishield, Sinopharm, Sputnik-V, Pfizer, Moderna, and Sinovac vaccines for use in Sri Lanka. Under the national inoculation drive, more than 99,500 individuals have been vaccinated against COVID-19 on Wednesday.', '2021-10-07', 'adaderana.lk', , 'a');
INSERT INTO `news` (`news_ID`, `title`, `description`, `date`, `author`, `picture`, `n_status`) VALUES
(2, 'Korea donates medical equipment to help Sri Lanka combat Covid-19', 'The Government of the Republic of Korea, through the Korea International Cooperation Agency (KOICA), has donated a consignment including PCR detection kits and 05 PCR machines for rapid testing valued at USD 450,000 to Sri Lanka. This generous contribution is in addition to previous donations of COVID-19 related medical equipment, the foreign ministry said. The donation from the Republic of Korea was handed over at a ceremony held at the Foreign Ministry in Colombo. Korean Ambassador Woonjin Jeong handed over the donation to Foreign Secretary Admiral Prof. Jayanath Colombage. “Sri Lanka and the Republic of Korea enjoy close ties of friendship and cooperation. Since the outbreak of the COVID 19 pandemic, the Republic of Korea has extended valuable COVID 19 related assistance to Sri Lanka,” the statement said.', '2021-10-07', 'adaderana.lk', , 'a');

